    "y[0,:] = y0\n",
    "\n",
    "predator_prey_ode = lambda t, y:predator_prey(t,y,a,alpha,c,gamma)\n",
    "p_p_solver = ode(predator_prey_ode).set_integrator('dopri5')\n",
    "\n",
    "p_p_solver.set_initial_value(y0,0)\n",
    "\n",
    "for j in range(1,len(t)):\n",
